  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Baugh and Verghese used unduplicated
  Medicaid enrollment records for 2005-2007 to examine enrollee migration between
  states. This study, published in Volume 3, Issue 4, of the Medicare and Medicaid
  Research Review, reports that, during the study period, only 3.7 percent of Medicaid
  enrollees moved to another state at least once, and the majority moved only once.
  Most moves (72.2 percent) were not associated with enrollment gaps, and 8.2 percent
  of moves were associated with gaps of fewer than three months. Enrollment gaps may
  indicate a lack of health insurance coverage, resulting in a lack of continuity
  of care and a risk to patient health outcomes, an increased use of higher cost emergency
  services, and higher system-wide health care costs. The studys findings provide
  a benchmark for adjusting national Medicaid statistics to reduce over-counting and
  improve the corresponding undercount in estimates of the uninsured population, thus,
  providing a context for further examining the consequences of enrollee moves on
  their health status and program expenditures.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
